                WriteLiteral(@"ss=""tab-pane fade show active"" id=""pills-home"" role=""tabpanel"" aria-labelledby=""pills-home-tab"">
                                    <h3 class=""tab-title"">Ürün Açıklaması</h3>
                                    <p>
                                        Meryem, görüntünün merkezinin çoğunu alarak kompozisyondaki en önemli figürdür.[3] Toprakla olan ilişkisinin temasını daha iyi iletmek için kendisi ve çim arasında bir yastık olmadan doğrudan yere oturmaktadır (?).[4] Her ne kadar Kutsal Aile'nin kompozisyonlarında olağandışı bir özellik olsa da, Yusuf resimde Meryem'den daha yüksek konumdadır. Meryem bacaklarının arasına, sanki Yusuf tarafından korunuyormuş gibi oturmaktadır. Yusuf'un büyük bacakları bir çeşit fiilî taht oluşturmaktadır. Meryem'in Çocuğu Yusuf'tan alıp almadığını ya da tam tersini belirten bazı tartışmalar vardır.[5] Floransa'nın koruyucusu olan Vaftizci Yahya, Madonna ve Çocuğu tasvir eden Florentine eserlerine çokça dahil edilmiştir.[6] Resmin orta yerinde, Kutsal Aile ve arkaplan aras");
                WriteLiteral(@"ındadır. Sahne kırsal bir sahne gibi gözükmekte, Kutsal Aile kendilerini çimlerde eğlenmekte ve alçak bir duvarın arkasındaki merakla (görünüşte) ilgisiz gruptan ayrılmaktadır.
                                    </p>
                                    <p>
                                        Resim hâlâ Michelangelo'nun tasarımı etkilemiş veya yardımcı olmuş olabileceği orijinal çerçevesindedir.[7] Çerçeve süslü bir şekilde oyulmuştur ve içerisine üç boyutlu olarak uzaya çıkan beş kafa için oldukça sıra dışıdır. Arka plandaki çıplaklara benzer şekilde, bu kafaların anlamları spekülasyon konusu olmuştur. Çerçeve aynı zamanda ay uyduları, yıldızlar, bitki örtüsü ve aslan başlarını da içermektedir. Bu semboller, belki de, her birinin armasından alınan Doni ve Strozzi ailelerine göndermedir.[8] Çerçevede tasvir edildiği gibi, muhtemelen iki ailenin evliliğine atıfta bulunarak ""aylar aslanlarla kenetlenen şeritler ile birbirine bağlıdır"".[8]
                                    </p>
                       ");
                WriteLiteral(@"             <p>
                                        Ön ve arka planı ayıran yatay bir bant, muhtemelen bir duvar bulunmaktadır.[5][6][9] Arka plan figürleri, anlamı ve işlevi çok fazla söylenti ve tartışmaya yol açan beş çıplak erkektir. Bize, izleyicilere çok daha yakın oldukları için Kutsal Aile, iki boyutlu bir görüntüde derin alan illüzyonuna yardımcı olan arka plandaki çıplaklardan çok daha büyük resmedilmiştir. Vaftizci Yahya'nın arkasında, 'ignudi'nin eğildiği ya da oturdukları yarı dairesel bir sırt vardır. Bu yarım daire, resmin kendisinin dairesel şeklini yansıtır ve ana grubun (Kutsal aile) dikey doğasına bir folyo görevi görür. Meryem ve Yusuf, İsa'ya bakarken arka plandaki çıplakların hiçbiri doğrudan ona bakmamaktadır.[10] Uzak arka plan, atmosferik perspektifle işlenmiş dağlık bir manzara içermektedir.
                                    </p>

                                </div>
                                <div class=""tab-pane fade"" id=""pills-profile"" role=""tabpanel"" aria-label");
                WriteLiteral(@"ledby=""pills-profile-tab"">
                                    <h3 class=""tab-title"">Sanatçının Hayatı</h3>
                                    <p>
                                        Michelangelo, 6 Mart 1475 tarihinde Caprese'de dünyaya geldi. Çok küçük yaşlarında ailesiyle bilrikte Floransa'ya geldi.
                                        6 yaşındayken annesini kaybetti.
                                    </p>
                                    <p>
                                        13 yaşındayken dönemin ünlü sanatçılarından Domenico Ghirlandaio'nun yanında eğitim almaya başladı.
                                        Henüz 26 yaşındayken, sanattaki yeteneğini ispat ettiği ""Kral Davud"" heykelini yaptı. (!Müstehcen!)
                                        1505 senesinde Papa II. Julius tarafından kendisine, en önemli başarılarından biri olarak görülen Vatikan’ın yanındaki Sistine Şapeli’nin tavan resimlerinin yapılması işi verildi. 3 sene sonra başlayacağı bu görevi sanatçı, 520 metr");
                WriteLiteral(@"ekarelik bir alanda yaklaşık dört yıllık bir çalışmanın ürünü olarak bitirdi.
                                        Rönesans sanatına benzersiz bir etkide bulunan Michelangelo, klasik sanat tekniklerini uygulamasının yanı sıra, esas olarak, aynı Leonardo da Vinci gibi insan formunu her açıdan tasvir edebilmek maksadıyla kadavralar üzerinde çalışıp, Yunan ve Roma sanatından esinlendiği idealleştirilmiş insan tasarımlarını ulaştığı gerçekçilik boyutuyla yakalamaya çalıştı.
                                        Batı resminin babası olarak kabul edilen Giotto’nun resmindeki doğal ve gerçekçi yaklaşım ile 15. yüzyıl başında tam olarak anlaşılabilen derinlikte perspektif olgusunu geliştirip kendi tarzına temel yapan Michelangelo, onlarca heykel, freske imza atıp Roma’nın yeniden inşa ve düzenlenmesinde de önemli görevler almıştır. Günümüzde birçok sanatçı, Michelangelo'u numune-i imtisal olarak görmektedir.
                                        Uzun yıllar sanat kariyerine devam eden Michelangelo, hayatını");
                WriteLiteral(@"n son dönemini Roma’daki Aziz Peter Kilisesi’nin mimarı olarak geçirmiş ve 18 Şubat 1564 tarihinde 89 yaşında hayatını kaybetmiştir.
                                    </p>
